import './App.css';
// import Login from 'C:/Users/namkyun/Desktop/workspace/today/src/components/Login.jsx';
import { BrowserRouter, Route, Router, Routes } from 'react-router-dom';
import Sidebar from 'C:/Users/namkyun/Desktop/workspace/today/src/components/Sidebar.jsx';
import ProfileEdit from './pages/ProfileEdit';
import MyPage from './pages/MyPage';
import EditProfile from './pages/EditProfile';


function App() {
  return (
    <div>
      <BrowserRouter>
        <Routes>
         <Route path="/" element={<MyPage />} ></Route>
         <Route path="/profile/edit" component={<EditProfile />} ></Route>
          {/* <Route path="/profile/edit" element={<ProfileEdit />} component={Sidebar} /> */}   
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
